@import "../../vars";
@import "../../vars";

header {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;

  z-index: 25;
  .container {
    padding: 45rem 52rem 0 59rem;
    display: flex;
    justify-content: space-between;
    align-items: flex-start;

  }
  &.fixed {
    position: fixed;
  }
}

.logo {
  font-family: "BigJohn";
  color: $text_color_light;
  font-size: 24rem;
  text-decoration: none;
  text-transform: uppercase;
}

.header_nav {
  position: relative;
}

.humburger {
  cursor: pointer;
  display: flex;
  margin-top: 13rem;
  align-items: flex-end;
  flex-direction: column;
  margin-bottom: 25rem;
  span {
    height: 2rem;
    display: block;
    width: 24rem;
    margin-bottom: 6rem;
    position: relative;
    overflow: hidden;
    transition: .3s;
  }
  span:last-of-type {
    width: 16rem;
  }
  &.close {
    span {
      &:nth-child(1) {
        transform: rotate(-45deg);
        margin-bottom: 0;
        margin-top: 4rem;

      }
      &:nth-child(2) {
        transform: rotate(45deg);
        margin-top: -2rem;

      }
      &:nth-child(3) {
        visibility: hidden;
        opacity: 0;
        margin-bottom: 10rem;
      }
    }
  }

}

.language {
  display: flex;
  flex-direction: column;
  position: absolute;
  top: 100%;
  left: 0;
}

.language_item {
  margin-bottom: 20rem;
  font-family: "SpaceGrotesk-Medium";
  font-size: 14rem;
  line-height: 13rem;
  letter-spacing: 0.05em;
  text-transform: uppercase;
  color: $text_color_light;
  transition: 0.3s ease all;
  cursor: pointer;
}

.language_item:hover {
  font-size: 18rem;
}

.last-article .language_item {
  color: $text_color_dark;
}

.last-article .humburger span {

}

.single-page .logo {
  color: $text_color_dark;
}

.single-page .language_item {
  color: $text_color_dark;
}

